import AuthImage from "../../reusables/AuthImages";

const ConfirmResetPassword = () => {
  return (
    <div>
      <AuthImages />
      <div>
        <h1>Reset Password</h1>
        <form action="">
          <div>
            <label htmlFor=""></label>
            <input
              type="password"
              placeholder=""
              name="password"
              onChange={onChangleHandler}
              className={classes.input}
              required
            />
          </div>
          <div>
            <label htmlFor=""></label>
            <input
              type="password"
              placeholder=""
              name="confirmPassword"
              onChange={onChangleHandler}
              className={classes.input}
              required
            />
          </div>
        </form>
      </div>
    </div>
  );
};

export default ConfirmResetPassword;
